                        {
                            return LoquiBinaryTranslation<SoundItem>.Instance.Parse(
                                frame: r,
                                item: out listSubItem,
                                masterReferences: masterReferences);
                        });
                    return TryGet<int?>.Succeed((int)CreatureSound_FieldIndex.Sounds);
                }
                default:
                    return TryGet<int?>.Failure;
            }
